/**
 * API for the localstorage
 * @constructor
*/
function Storage(){}Storage.prototype.storeData=function(t,e){e=JSON.stringify(e),localStorage.setItem(t,e)},Storage.prototype.readData=function(t){var e=localStorage.getItem(t)
return JSON.parse(e)},Storage.prototype.clearData=function(){localStorage.clear()},Storage.prototype.clearKey=function(t){localStorage.setItem(t,null)},Storage.prototype.getAllKey=function(){var t=[]
for(var e in localStorage)t.push(e)
return t},Storage.prototype.getAllData=function(){var t=getAllKey(),e={}
for(var o in t)o=t[o],e[o]=readData(o)
return e}
